    data: |
      SELECT DISTINCT - col2 + - 1 * - 44, - col2 * ( 57 ) + + 10 AS col2 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q4811.out
    data: |
      -3	-2669
      -55	-5633
      34	-560
